// contracts/VotingEvent.sol
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";

contract VotingEvent is Ownable {
    // Pass msg.sender to the Ownable constructor.
    constructor() Ownable(msg.sender) {}

    struct Event {
        uint256 id;
        string name;
        string description;
        uint256 startTime; // Unix timestamp
        uint256 endTime;   // Unix timestamp
        bool finalized;
        string winner;     // Winner's name
    }
    
    uint256 public eventCount;
    mapping(uint256 => Event) public events;
    
    event EventCreated(uint256 indexed eventId, string name, uint256 startTime, uint256 endTime);
    event EventFinalized(uint256 indexed eventId, string winner);

    /// @notice Create a new voting event. Only the owner can call this.
    /// @param _name Name of the event.
    /// @param _description Description of the event.
    /// @param _startTime Unix timestamp when voting starts.
    /// @param _endTime Unix timestamp when voting ends.
    function createEvent(
        string memory _name,
        string memory _description,
        uint256 _startTime,
        uint256 _endTime
    ) external onlyOwner returns (uint256) {
        require(_startTime < _endTime, "Start time must be before end time");
        eventCount++;
        events[eventCount] = Event({
            id: eventCount,
            name: _name,
            description: _description,
            startTime: _startTime,
            endTime: _endTime,
            finalized: false,
            winner: ""
        });
        emit EventCreated(eventCount, _name, _startTime, _endTime);
        return eventCount;
    }

    /// @notice Finalize an event and record the winner. Only the owner can call this.
    /// @param _eventId ID of the event.
    /// @param _winner The winner’s name.
    function finalizeEvent(uint256 _eventId, string memory _winner) external onlyOwner {
        Event storage evt = events[_eventId];
        require(block.timestamp > evt.endTime, "Voting still in progress");
        require(!evt.finalized, "Event already finalized");
        evt.finalized = true;
        evt.winner = _winner;
        emit EventFinalized(_eventId, _winner);
    }

    /// @notice Retrieve an event’s details with explicit return values.
    /// @param _eventId ID of the event.
    function getEventDetails(uint256 _eventId)
        external
        view
        returns (
            uint256 id,
            string memory name,
            string memory description,
            uint256 startTime,
            uint256 endTime,
            bool finalized,
            string memory winner
        )
    {
        Event memory evt = events[_eventId];
        return (evt.id, evt.name, evt.description, evt.startTime, evt.endTime, evt.finalized, evt.winner);
    }
}

